%script
--also make BUILDING_CLASS_CATEGORY invisible since its redundant with BUILDING_CLASS_AT_SALE
begin execute immediate 'drop table brooklyn_v2'; exception when others then null; end;
/
create table brooklyn_v2 as 
    select * from brooklyn_v1 where BUILDING_CLASS_CATEGORY in ('02 TWO FAMILY HOMES', '01 ONE FAMILY HOMES');
alter table brooklyn_v2 modify BUILDING_CLASS_CATEGORY invisible;
select count(*) from brooklyn_v2;

%script
--flag records as train:test:validation samples with 50:50 split and making ran_num column invisible
begin execute immediate 'drop table brooklyn_v4'; exception when others then null; end;
/
create table brooklyn_v4 as 
    (select B.*, 
        case when (B.ran_num < 0.5) then 'train'
        when (B.ran_num > 0.5) then 'test'
        end as TT 
        from BROOKLYN_V3 B);
alter table brooklyn_v4 modify ran_num invisible;
select TT, count(*) as N_records from brooklyn_v4 group by TT order by TT;

%script
begin execute immediate 'drop table brooklyn_v5'; exception when others then null; end;
/
create table brooklyn_v5 as 
    select * from
        (select rownum + 100000 as AIN, address_ from (select unique(address_) as address_ from BROOKLYN_V4))
        join
        (select * from BROOKLYN_V4)
        using (address_);
select count(*) from brooklyn_v5;

%script
--note that TT is invisible in all tables, with sale_date,yearbuilt,address_,ain columns being invisible in the training sample only
begin execute immediate 'drop table brooklyn_train'; exception when others then null; end;
/
create table brooklyn_train as 
    select * from BROOKLYN_V5 where (TT = 'train');
alter table brooklyn_train modify TT INVISIBLE;
alter table brooklyn_train modify sale_date INVISIBLE;
alter table brooklyn_train modify yearbuilt INVISIBLE;
alter table brooklyn_train modify address_ INVISIBLE;
alter table brooklyn_train modify ain INVISIBLE;
select count(*) from brooklyn_train;

begin execute immediate 'drop table brooklyn_test'; exception when others then null; end;
/
create table brooklyn_test as 
    select * from BROOKLYN_V5 where (TT = 'test');
alter table brooklyn_test modify TT INVISIBLE;
select count(*) from brooklyn_test;

%script
drop table brooklyn_v1;
drop table brooklyn_v2;
drop table brooklyn_v3;
drop table brooklyn_v4;
drop table brooklyn_v5;

%script
--copy brooklyn_train table to brooklyn_train_filtered, ditto for test
begin execute immediate 'drop table brooklyn_train_filtered'; exception when others then null; end;
/
create table brooklyn_train_filtered as 
    select * from brooklyn_train;
select count(*) from brooklyn_train_filtered;

begin execute immediate 'drop table brooklyn_test_filtered'; exception when others then null; end;
/
create table brooklyn_test_filtered as 
    select * from brooklyn_test;
select count(*) from brooklyn_test_filtered;

%sql
--roughly 0.6B$ in residential1-2 family homes change hands each quarter across Brooklyn
select 2.0*sum(sale_price)/1.0e9 as total_sale_price, year_quarter from
    (select sale_price, to_char(extract(year from to_date(sale_date, 'YYYY-MM-DD'))) || '.' || 3*to_char(to_date(sale_date, 'YYYY-MM-DD'), 'Q') as year_quarter 
        from brooklyn_test)
    group by year_quarter order by year_quarter;
